            <Card>
                <CardHeader>
                    Geselecteerde Filters
                </CardHeader>
                <CardBody>
                    <h4>Geselecteerde Modules: </h4>
                    <ul>
                        {selectedModules.map(this.renderModules)}
                    </ul>
                </CardBody>
            </Card>
        )
    }
}

